import React from "react";

import { StyleSheet, Text, View } from "react-native";
import {Box, Heading, HStack,Stack} from "native-base"


import { Button, VStack,
    Image,
    ScrollView,
    Center,
    NativeBaseProvider, } from "native-base";
import Footer from "../footer/Footer";
import TripUpdateModal from "../trips/TripUpdateModal";

const Home = ({ navigation }) => {
  return (
      
    <View>
  <ScrollView px="20">
      <Center mt="3">
        <VStack space={2} alignItems="center" safeAreaTop my={6}>
          { (
            <Image
            width={250}
            height={250}
              resizeMode="cover"
              source={{
                uri: "https://wakingupwild.com/wp-content/uploads/slider-safety-2.jpg",
              }}
              alt={"Alternate Text " }
            />
          )}
        </VStack>
      </Center>
    </ScrollView>
      <Box>
          <Center>
        <Heading size="xl" mb="4">
          Trip
        </Heading>
        <Text fontSize="xl">
          (noun) a journey or excursion, especially for pleasure.
        </Text>
        </Center>
      </Box>
      <Footer navigation={navigation} />
      {/* <Text> Hi </Text> */}
<TripUpdateModal/>
      {/* <Footer navigation={navigation}/> */}
      {/* <Text> Hi </Text> */}
      <Stack space="2" alignItems="center">
      <VStack space="2" alignItems="center">
      <Center>
      <Button
        title="NOMAD"
        color="#0000ff"
        width="50"
        height="50"
        onPress={() => navigation.navigate("TripList")}
      >Trip List</Button>
     </Center>
     <Center>
      <Button
        title="NOMAD"
        color="#0000ff"
        width="50"
        height="50"
        onPress={() => navigation.navigate("Signin")}
      >Sign in</Button>
      </Center>
      <Center>
            <Button
        title="NOMAD"
        color="#0000ff"
        width="50"
        height="50"
        onPress={() => navigation.navigate("ProfileList")}
      >Profile</Button>


      {/* <Button 
             title="signin"
             onPress={() => navigation.navigate("Signin")}
             /> */}
      </Center>
     </VStack>
      </Stack>
    </View>
  );
};

export default Home;

const styles = StyleSheet.create({});
